name = "wheely-bucket"
version = "0.2.0"
source = { editable = "." }
dependencies = [
    { name = "packaging" },
    { name = "pip" },
    { name = "typer-slim" },
]

[package.dev-dependencies]
dev = [
    { name = "black" },
    { name = "cogapp" },
    { name = "flake8" },
    { name = "flake8-annotations" },
    { name = "flake8-define-class-attributes" },
    { name = "isort" },
    { name = "mypy" },
    { name = "pre-commit" },
    { name = "pytest" },
    { name = "pytest-cov" },
    { name = "pytest-mock" },
    { name = "pytest-randomly" },
    { name = "ruff" },
    { name = "rumdl" },
    { name = "sco1-bumper" },
    { name = "tox" },
    { name = "tox-uv" },
]

[package.metadata]
requires-dist = [
    { name = "packaging", specifier = "~=25.0" },
    { name = "pip", specifier = ">=25.2" },
    { name = "typer-slim", specifier = "~=0.17" },
]

[package.metadata.requires-dev]
dev = [
    { name = "black", specifier = "~=25.0" },
    { name = "cogapp", specifier = "~=3.5" },
    { name = "flake8", specifier = "~=7.1" },
    { name = "flake8-annotations", specifier = "~=3.1" },
    { name = "flake8-define-class-attributes", specifier = "~=0.2" },
    { name = "isort", specifier = "~=6.0" },
    { name = "mypy", specifier = "~=1.14" },
    { name = "pre-commit", specifier = "~=4.0" },
    { name = "pytest", specifier = "~=8.3" },
    { name = "pytest-cov", specifier = "~=6.0" },
    { name = "pytest-mock", specifier = "~=3.14" },
    { name = "pytest-randomly", specifier = "~=3.16" },
    { name = "ruff", specifier = "~=0.9" },
    { name = "rumdl", specifier = "~=0.0.128" },
    { name = "sco1-bumper", specifier = "~=2.0" },
    { name = "tox", specifier = "~=4.23" },
    { name = "tox-uv", specifier = "~=1.17" },
]
